def transform(sequence):
    count = 0
    transformed_seq = []
    for num in sequence:
        if num != 0 or count == 0:
            transformed_seq.append(num)
        elif num == 0:
            count += 1
    while count > 0:
        transformed_seq.append(0)
        count -= 1
    return transformed_seq
